const tileElement = document.getElementById("tiles");
const GUESSES = parseInt(tileElement.dataset.guesses);
const WORD_LENGTH = parseInt(tileElement.className[4]);
const WORD_LIST = ALL_WORDS["words" + WORD_LENGTH];
const SELECTED_WORD = WORD_LIST[Math.floor(Math.random()*WORD_LIST.length)];
console.log(SELECTED_WORD);

// GENERATE TILES
const generateTiles = () => {
    let tilesHTML = '';
    for (let i = 0; i < GUESSES; i++) {
        tilesHTML += `<div class="guess" id="guess-${i}">`;
        for (let j = 0; j < WORD_LENGTH; j++) {
            tilesHTML += `<div class="letters"></div>`;
        }
        tilesHTML += '</div>';
    }
    return tilesHTML;
}
document.getElementById("tiles").innerHTML = generateTiles();

// PROCESS WORD
function checkWord(word, guessChildren) {
    for (let i=0; i < WORD_LENGTH; i++) {
        if (word[i] == SELECTED_WORD[i]) guessChildren[i].style.background = "green";
        else if (SELECTED_WORD.includes(word[i])) guessChildren[i].style.background = "orange";
        else guessChildren[i].style.background = "grey";
    }
    if (word == SELECTED_WORD) return true;
    return false;
}

function isLetter(str) {
    return str.length === 1 && str.match(/[a-z]/i);
}

// PROCESS INPUT
var currentLetterIndex = 0;
var currentGuess = 0;
var currentWord = '';
var gameOver = false;
document.addEventListener("keydown", (event) => {
    const key = event.key.toLowerCase();
    const guessElement = document.getElementById(`guess-${currentGuess}`);

    if (gameOver) {
        INFO_BOX.innerHTML = "Refresh to play again.";
    }

    else if (isLetter(key)) {
        guessElement.children[currentLetterIndex].innerHTML = key;

        currentWord += key;
        
        if (currentLetterIndex >= WORD_LENGTH - 1) {
            if (!WORD_LIST.includes(currentWord)) {
                INFO_BOX.innerHTML = `${currentWord} not in word list. Enter another`;
                [...guessElement.children].forEach((letter) => {
                    letter.innerHTML = '';
                });
            }
            else {
                isCorrect = checkWord(currentWord, guessElement.children);
                if (isCorrect) {
                    INFO_BOX.innerHTML = "Winner! Refresh to play again.";
                    gameOver = true;
                }
                else if (currentGuess >= GUESSES - 1) {
                    INFO_BOX.innerHTML = `Loser! Word was: ${SELECTED_WORD}. Refresh to play again.`;
                    gameOver = true;
                }
                currentGuess += 1;
            }
            currentLetterIndex = 0;
            currentWord = '';
        } else {
            currentLetterIndex += 1;
        }
    }
    else if(event.key === "Backspace" && currentLetterIndex > 0 && currentLetterIndex < WORD_LENGTH) {
        // Can't delete last letter as word is already submitted upon the last letter entered
        currentLetterIndex -= 1;
        currentWord = currentWord.slice(0, -1);
        guessElement.children[currentLetterIndex].innerHTML = '';
    }
});
